      #globalContainer {
        min-width: 320px;
        height: 100%;
        min-height: 100%;
        position: relative;
        z-index: 1
      }

      #globalContainer #headerContainer {
        position: fixed;
        width: 100%;
        max-width: 71.25rem;
        z-index: 4;
        background: #fff;
        border-bottom: 1px solid #d9d9d9;
        box-shadow: 0 10px 10px -10px #999
      }

      #globalContainer #mainContainer {
        position: relative;
        z-index: 2;
        width: 100%;
        overflow: hidden
      }

      #globalContainer #mainContainer.overlay #rightContainer {
        top: 0 !important
      }

      #globalContainer #mainContainer.overlay #rightContainer .panel {
        position: relative !important
      }

      #globalContainer #mainContainer.overlay:after {
        content: "";
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        background-color: rgba(0, 0, 0, 0.3);
        z-index: 100
      }

      #globalContainer #mainContainer>div:first-child {
        display: table;
        width: 100%;
        table-layout: fixed;
        position: relative
      }

      #globalContainer #mainContainer>div:first-child:after {
        content: "";
        display: block;
        position: fixed;
        width: 28%;
        height: 100%;
        background: #fff;
        z-index: 6
      }

      #globalContainer #mainContainer #leftContainer {
        display: table-cell;
        vertical-align: top;
        width: 92%;
        z-index: 3;
        transition: all .5s
      }

      #globalContainer #mainContainer #leftContainer.simuOpen {
        width: 64%
      }

      #globalContainer #mainContainer #leftContainer.simuOpen+#rightContainer {
        position: relative
      }

      #globalContainer #mainContainer #leftContainer.simuOpen+#rightContainer.open {
        right: 0
