      .progress-indicator {
        list-style: none;
        width: 100%;
        margin: 0 auto;
        padding: 0;
        display: table;
        table-layout: fixed;
        z-index: 0
      }

      .progress-indicator>li {
        position: relative;
        display: table-cell;
        text-align: center;
        font-size: 10px;
        z-index: 0
      }

      .progress-indicator>li span {
        position: absolute;
        -webkit-transform: translateX(-50%);
        -ms-transform: translateX(-50%);
        transform: translateX(-50%);
        font-size: 10px;
        letter-spacing: 0.05px;
        width: auto;
        left: 50%
      }

      .progress-indicator>li::before {
        content: "\2713";
        display: block;
        margin: 0 auto;
        background: #e6e6e6;
        width: 16px;
        height: 16px;
        text-align: center;
        margin-bottom: 0.25em;
        line-height: 6px;
        border-radius: 100%;
        position: relative;
        z-index: 999
      }

      .progress-indicator>li::after {
        content: '';
        position: absolute;
        display: block;
        background: #e6e6e6;
        width: calc(100% - 14px);
        height: 0.15em;
        top: 50%;
        -webkit-transform: translateY(-100%);
        -ms-transform: translateY(-100%);
        transform: translateY(-100%);
        left: calc(50% + 8px);
        margin-left: 1.5em\9;
        z-index: 1000
      }

      .progress-indicator>li:last-child:after {
        display: none
      }

      .progress-indicator>li.is-complete::before,
      .progress-indicator>li.is-complete::after {
        color: #fefefe;
        background: #1aa4a7
      }

      .progress-indicator>li.is-current::before {
        color: transparent;
        background: #1aa4a7;
        content: "\1f534";
        border: 3px double #fff;
        padding: 1px
      }

      .progress-indicator>li.is-next::before {
        color: #fefefe;
        background: #fff;
        content: "\29bf";
        border: 1px solid #e6e6e6
      }

      .progress-indicator>li::before {
        padding: 5px
      }

      .progress-indicator>li.iscurrent::before {
        color: transparent;
        background: #1aa4a7;
        content: "\29bf";
        border: 3px double #fff;
        padding: 2px
      }

      .progress-indicator>li.isnext::before {
        color: #fefefe;
        background: #fff;
        content: "\29bf";
        border: 1px solid #e6e6e6
      }

      .progress-indicator>li.iscomplete::before,
      .progress-indicator>li.iscomplete::after {
        color: #fefefe;
        background: #1aa4a7
      }

      .progress-indicator>li.iscurrent::before {
        color: transparent;
        background: #1aa4a7;
        content: "\29bf";
        border: 3px double #fff;
        padding: 2px
      }

      .progress-indicator>li.isnext::before {
        color: #fefefe;
        background: #fff;
        content: "\29bf";
        border: 1px solid #e6e6e6
      }

